"use strict";(self.webpackChunkdocusaurus_demo=self.webpackChunkdocusaurus_demo||[]).push([[837],{327:o=>{o.exports=JSON.parse('{"blogPosts":[{"id":"Bemvindo","metadata":{"permalink":"/ADC_TP3/blog/Bemvindo","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Bemvindo","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"26 de agosto de 2021","tags":[{"label":"facebook","permalink":"/ADC_TP3/blog/tags/facebook"},{"label":"hello","permalink":"/ADC_TP3/blog/tags/hello"},{"label":"docusaurus","permalink":"/ADC_TP3/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"Nuno Vivas","title":"Aluno do Primeiro Semestre de LESTI","url":"https://www.facebook.com/Vivas.Nuno","imageURL":"https://github.com/slorber.png","key":"vivas"},{"name":"Sophia Soares","title":"Aluna do Primeiro Semestre de LESTI","url":"https://sophiasoares.instagram.com","imageURL":"https://creativetoys.pt/wp-content/uploads/63220038-Squishmallows-Pikachu-Guino-25cm-1.jpg","key":"soares"},{"name":"Andr\xe9s Echeverry","title":"Aluno do Primeiro Semestre de LESTI","url":"https://andresecheverry.instagram.com","imageURL":"https://cdn.pixabay.com/photo/2017/07/06/18/48/superman-2478978_1280.jpg","key":"echeverry"}],"frontMatter":{"slug":"Bemvindo","title":"Bemvindo","authors":["vivas","soares","echeverry"],"tags":["facebook","hello","docusaurus"]},"nextItem":{"title":"MDX Blog Post","permalink":"/ADC_TP3/blog/mdx-blog-post"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."},{"id":"mdx-blog-post","metadata":{"permalink":"/ADC_TP3/blog/mdx-blog-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2021-08-01-mdx-blog-post.mdx","source":"@site/blog/2021-08-01-mdx-blog-post.mdx","title":"MDX Blog Post","description":"Blog posts support Docusaurus Markdown features, such as MDX.","date":"2021-08-01T00:00:00.000Z","formattedDate":"1 de agosto de 2021","tags":[{"label":"docusaurus","permalink":"/ADC_TP3/blog/tags/docusaurus"}],"readingTime":0.175,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"}],"frontMatter":{"slug":"mdx-blog-post","title":"MDX Blog Post","authors":["slorber"],"tags":["docusaurus"]},"prevItem":{"title":"Bemvindo","permalink":"/ADC_TP3/blog/Bemvindo"},"nextItem":{"title":"Long Blog Post","permalink":"/ADC_TP3/blog/long-blog-post"}},"content":"Blog posts support [Docusaurus Markdown features](https://docusaurus.io/docs/markdown-features), such as [MDX](https://mdxjs.com/).\\n\\n:::tip\\n\\nUse the power of React to create interactive blog posts.\\n\\n```js\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n```\\n\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n\\n:::"},{"id":"long-blog-post","metadata":{"permalink":"/ADC_TP3/blog/long-blog-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-29-long-blog-post.md","source":"@site/blog/2019-05-29-long-blog-post.md","title":"Long Blog Post","description":"- Inicio do Projeto","date":"2019-05-29T00:00:00.000Z","formattedDate":"29 de maio de 2019","tags":[{"label":"hello","permalink":"/ADC_TP3/blog/tags/hello"},{"label":"docusaurus","permalink":"/ADC_TP3/blog/tags/docusaurus"}],"readingTime":1.88,"hasTruncateMarker":false,"authors":[{"name":"Endilie Yacop Sucipto","title":"Maintainer of Docusaurus","url":"https://github.com/endiliey","imageURL":"https://github.com/endiliey.png","key":"endi"}],"frontMatter":{"slug":"long-blog-post","title":"Long Blog Post","authors":"endi","tags":["hello","docusaurus"]},"prevItem":{"title":"MDX Blog Post","permalink":"/ADC_TP3/blog/mdx-blog-post"},"nextItem":{"title":"First Blog Post","permalink":"/ADC_TP3/blog/first-blog-post"}},"content":"\x3c!--esse post de blog deve apresentar mais funcionalidades do MarkDown e ser dividido em um texto de 3 partes, assim como o pr\xf3prio projeto--\x3e\\n\\n# *Autom\xf3veis Maravilha*\\n\x3c!--Aqui pode come\xe7ar, introduzindo sobre as partes mais iniciais de forma breve, como o jira,biggant e o trello --\x3e\\n##  - Inicio do Projeto\\n\\nTudo come\xe7ou, quando aprendemos a parte mais organizacional do porjeto, utlizando ferramentas como o \\"jira\\" junto ao \\"Biggant\\" e logo em seguida passamos para o [Trello](https://trello.com/?&aceid=&adposition=&adgroup=142052239375&campaign=18422680946&creative=666240335175&device=c&keyword=trello&matchtype=e&network=g&placement=&ds_kids=p73319094492&ds_e=GOOGLE&ds_eid=700000001557344&ds_e1=GOOGLE&gad_source=1&gclid=Cj0KCQiAsvWrBhC0ARIsAO4E6f8I0g0BcCCfGYX_RsCPL2WVGBVTIDY0COnVKlz_3Dgdt6lyP8-jC54aAsH9EALw_wcB&gclsrc=aw.ds), l\xe1 trabalhamos com as **User Stories**, para poder fazer **Backlogs** e organizar os supostos **Sprints** do trabalho\\n\\n## - Formata\xe7\xe3o do Projeto \\n\x3c!--Ja nesta parte foquemos mais na segunda etapa do projeto,git,comando, sphinx --\x3e\\nJ\xe1 para esta segunda etapa do nosso projeto, a gente focou mas n\xe1 parte formata\xe7\xe3o e docuementa\xe7\xe3o das nossas atividades. Para fazer isso da maneira mais qualificada, utilizamos a ferramenta do [GitHub](https://github.com/), onde nela conseguimos adicionar, assim como no trello, todos os participantes/autores do projeto, assim podemos ver tudo aquilo que est\xe1 sendo desenvolvido, monitorando o processo de ajuste de cada um e assim otimizando a cria\xe7\xe3o do projeto.\\n\\n    Para ficar mais otimizado seguimos certos passos para poder criar as partes do nosso projeto:\\n    - clonamos o repositorio remoto em nossa maquina\\n    - criamos branchs proprias (a parte da branch principal \\"main\\")\\n    - fazemos modifica\xe7\xf5es necess\xe1rias: git add . ; git commit -m \\" \\"; git push\\n    - por fim, para que a informa\xe7\xe3o que modificamos em nossa branch local seja atualizada com a branch main, damos um pull e posteriormente,caso tudo esteja correto, damos um merge, e assim toda a informa\xe7\xe3o modificada \xe9 passada para \\"main\\".\\n\\nPosteriormente, finalizamos essa parte criando uma documenta\xe7\xe3o, em **Sphinx**, correlacionada ao projeto. \\n\\n## - Finaliza\xe7\xe3o *(Cria\xe7\xe3o de um site)*  \\n\x3c!-- Agora para essa parte \xe9 so falarmos sobre o docussauros --\x3e\\nPor fim, para que possamos finalizar esse projeto, nada menos justo que criarmos um site para ele, assim ele poder\xe1 ser visualizado por outras pessoas e ganhar um alcance maior. Logo \xe9 para isso que estamos utilizando a plataforma do **Docussauros**, para que podemos criar uma interface da nossa concession\xe1ria utilizando **Markdown**, **Git**, e conhecimento adquirido ao longo do semestre para que tal trabalho possa ser finalizado\\n\\nClique para poder vizualizar a nossa p\xe1gina do docussauros:\\n     [http://localhost:3000/ADC_TP3/](http://localhost:3000/ADC_TP3/)"},{"id":"first-blog-post","metadata":{"permalink":"/ADC_TP3/blog/first-blog-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2019-05-28-first-blog-post.md","source":"@site/blog/2019-05-28-first-blog-post.md","title":"First Blog Post","description":"Sejam bem-vindos!","date":"2019-05-28T00:00:00.000Z","formattedDate":"28 de maio de 2019","tags":[],"readingTime":0.44,"hasTruncateMarker":false,"authors":[{"name":"Sophia Soares","url":"https://sophiasoares.instagram.com"}],"frontMatter":{"slug":"first-blog-post","title":"First Blog Post","authors":[{"name":"Sophia Soares","url":"https://sophiasoares.instagram.com"}],"image_url":"https://creativetoys.pt/wp-content/uploads/63220038-Squishmallows-Pikachu-Guino-25cm-1.jpg"},"prevItem":{"title":"Long Blog Post","permalink":"/ADC_TP3/blog/long-blog-post"}},"content":"**Sejam bem-vindos!** \\n   \\n\xc9 com muita felicidade que n\xf3s alunos do primeiro semestre de LESTI, da disciplina de Ambientes de Desenvolvimento\\nColaborativo, podemos vos apresentar o primeiro post do nosso blog, sobre o nosso trabalho \\"Automoveis Maravilha\\". \\nAo longo desse Blog, estaremos trazendo para voc\xeas espectadores, como foi todo esse nosso processo de constru\xe7\xe3o do trabalho e nosso desenvolvimento em grupo, juntamente com a ajuda e os fundamentos do professor que lic\xeancia esta \\nmat\xe9ria, e qual \xe9 o nosso objetivo com esse projeto sobre a nossa concession\xe1ria \\"Automov\xe9is Maravilha\\""}]}')}}]);